import React from 'react';
import styled from 'styled-components';

const LogoImage = styled.img`
  aspect-ratio: 1.5;
  object-fit: contain;
  object-position: center;
  width: 170px;
  max-width: 100%;
  @media (max-width: 991px) {
    margin-top: 40px;
  }
`;

function Logo() {
  return (
    <LogoImage src="https://cdn.builder.io/api/v1/image/assets/TEMP/5e9d3b3d09c8c9163485b53d08a23f61c1f95603937c745e268084ff02bd34b2?apiKey=e3765372b84f44f7af794f9207eac8b0&" alt="Company Logo" loading="lazy" />
  );
}

export default Logo;
